// 238. Product of Array Except Self

// Given an integer array nums, return an array answer such that answer[i] is equal to the product of all the elements of nums except nums[i].

// The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.


// Example 1:

// Input: nums = [1,2,3,4]
// Output: [24,12,8,6]

// Example 2:

// Input: nums = [-1,1,0,-3,3]
// Output: [0,0,9,0,0]


// Constraints:

// 2 <= nums.length <= 10^5
// -30 <= nums[i] <= 30
// The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.


// Follow up:

// Could you solve it in O(n) time complexity and without using division?
// Could you solve it with O(1) constant space complexity? (The output array does not count as extra space for space complexity analysis.)

function productExceptSelf(nums: number[]): number[] {
    let products: number[] = []

    const containsAtLeastOneZero = nums.filter(x => x === 0).length !== 0

    let totalProduct = 0
    if (!containsAtLeastOneZero) {
        totalProduct = nums.reduce((a,b) => (a*b))
    }

    for (let i = 0; i < nums.length; i++) {
        if (containsAtLeastOneZero) {
            products[i] = 1
            for (let j = 0; j < nums.length; j++) {
                if (i != j) {
                    products[i] *= nums[j]
                }

                if (products[i] == 0) {
                    break
                }
            }

            if (products[i] === -0) { products[i] = 0 }
        }
        else {
            products[i] = totalProduct / nums[i]
        }
    }

    return products
};

console.log(productExceptSelf([1,2,3,4])) // Output: [24,12,8,6]
console.log(productExceptSelf([-1,1,0,-3,3])) // Output: [0,0,9,0,0]
console.log(productExceptSelf([0,0])) // Output: [0, 0]
console.log(productExceptSelf([2,2])) // Output: [2, 2]
